(1, 1, 'About Us', 'Abiding Development and Holdings Limited as well as there sister concerns believe in continuous product innovation and excellent service. Therefore, we are also concentrating on Quality Management. We are continuously upgrading our staff in their competence and knowledge and equip them with better service skills in order to exceed our customers expectations.\r\n\r\nAbiding Development and Holdings Limited as well as there sister concerns offer a development service to our clients. This includes providing analysis, assessment according to there budget, suggesting the best option for our clients, developing the land area, performing construction work, proper government registration , preparing other necessary legal documents, assuring necessary utility connection and so on.\r\n\r\nHousing could be generally termed as a habitable shelter but its meaning stretches far from merely a shelter. It is the total living environment including dwelling units, land, the neighborhood services and utilities needed for the well being of its inhabitants. Housing is one of the basic beings, which provides security, and sense of belonging to the owner. The pre-requisite for health and comfort is proper housing.', 100),
(2, 1, 'Terms and Conditions', '1. Allotment: Interested persons are welcome to apply for allotment of apartments. The application should be made on the prescribed form along with the booking money/earnest money. On acceptance of application, Abiding Development & Holdings Ltd. will issue a provisional allotment letter in favour of the applicant along with the schedule of payment for balance amount. 30% down payment will have to made within 15 days from the date of issuing of provisional allotment letter. Allotment will be made on first come first served basis. Buyers willing to make onetime payment will be given preference. The company has the right to accept or reject any application without assigning any reason there to.\r\n\r\n2. Payments: All payments (Down payment, installments, car park cost, Utility Cost, additional works and other charges) should be made in favour of Abiding Development & Holdings Ltd. in the form of Cash/Demand Draft or Pay Order from a schedule bank of Bangladesh. Bangladeshi residing abroad may ensure payment in foreign Exchange by TT or DD as per exchange rate issued by Bangladesh bank on the due date of installment payment.\r\n\r\n3.	Delay in Payment: Payments of Installments and all other charges are to be made on the due date. Any delay in payment up to 30 days will make the buyer liable to pay an additional payment @ 3% per 30 days on amount of payment delayed. If the payment is delayed more than 60 days, then the company shall have the right to cancel the allotment. In this case the amount paid by buyer will be refunded after deducting service charge of Tk. 1,00,000.00.The balance amount will be back after selling of the said apartment to the new buyer. \r\n\r\n4. Deed of Agreement: After down payment of 30% of the total price Abiding Development & Holdings Ltd. and the Allottee shall execute a Deed of Agreement for safe guarding the interest of the Allottee as well as the Company.\r\n\r\n5.	Allotment Transfer: the buyer shall not transfer or sell the allotted apartment to a third party before registration. But if the buyer desire to  transfer  his/her apartment to a nearest relative, in such case the company have right to demand 2% of total flat cost  as a documentation charge related to transfer of allotment\r\n\r\n6. Design & Layout: Limited changes in the design and specifications and/ or layout of the apartments and other facilities may be made by Abiding Development & Holdings Ltd. for the overall interest of the project or due to unavoidable reasons. If the floor covering areas increased or decreased, the allottee will have to pay as per actual measurement with common space.\r\n\r\n7. Utility Connection: Connection fees/charges, security deposits and other relevant/incidental expenses relating to gas, water, sewerage and electric connections are not included in the price of apartments. This payment will be made by the purchaser through Abiding Development & Holdings Ltd. to the concerned authorities. If will provided solar panel in the project buyers will have to pay extra cost for this purpose. \r\n\r\n8. Title of the Land: Proportionate share of land of the project will be transferred to the allottee after payment of all dues. The allottee will bear all costs such as stamp duties, registration fees, Vat, sale permission cost, Taxes related with land and Apartment transfer and registration procedure.\r\n\r\n9. Possession Transfer: The possession of each apartment shall be duly handed over to the allottee on completion and on full payment of installments & other charges & dues amount.\r\n\r\n\r\n10. Abandon of project: The completion period of construction of the project can be affected by unavoidable circumstances like as Acts of God, Natural calamities, political or civil disturbance, civil war, govt. policies or any other reason, time period for completion of project may be extended or if the company compel to abandon the project, the buyer shall be refunded with all deposited money, in such situations the buyer will not be entitled to claim any kind of compensation or interest on the money deposited.\r\n\r\n', 97),
(4, 1, 'Building Features and  Amenities', '	Building will be planned and designed by professional Architects and structural design Engineers. \r\n	For all service connections and disposals (sewerage, solid waste, etc.) British/American/BNBC building codes will be followed. \r\n	Structural design parameters will be based of American Concrete Institute (ACI) and American Standards of Testing Materials (ASTM) and BNBC codes. \r\n	Sub-soil investigation and soil composition will be analyzed from laboratory. \r\n	Building will be comprised of reinforced cement concrete (R.C.C) foundation, column, beam and slab considering systematic and wind effect with modern design concept. \r\n	Comprehensive checking and testing of all steel reinforcement will be conducted by professional design and supervising engineers. \r\n	All structural materials including steel (60 grade deformed / tore steel bar), cement (Crown, Akij, King Brand, SKS etc.), bricks (1st class), Sylhet sand, etc, will be of highest available standard. \r\n	For concrete works to give crushing strengths of 2500 psi to 4000 psi (cyl. test) at 28 days depending on concrete ratio & design. ', 98),
(6, 1, 'Our Believe', 'We believe in continuous product innovation and excellent service. Therefore, we are also concentrating on Quality Management. We are continuously upgrading our staff in their competence and knowledge and equip them with better service skills in order to exceed our customers expectations.', 96),
