(55, 5, 'Abiding Development and Holdings Limited', 'Abiding Development and Holdings Limited as well as there sister concerns are devoted to make your dreams real. We assist our clients in identifying their entire needs. We help our clients streamline their operations through strategic implementation. Our mission is to work with our clients to develop the best possible habitat. We are committed to helping our clients to turn there dreams into really.', 100),
(56, 5, 'Unique Webers Ltd.', 'Unique Webers Ltd. is a Database Solution development, Software development and Website designing company who started their journey in 2010. At first Unique Webers Ltd. were limited in developing online databases and websites, but soon Unique Webers Ltd. got involved in developing both online and offline databases. Later in order to provide clients with excellence the innovative researchers developed a new and innovative Hybrid database technology which provides both multiuser online access like online database and speed of offline database. \r\n\r\nUnique Webers Ltd. team is a group of young, energetic and enthusiastic persons. Unique Webers Ltd. promise to fully satisfy our clients by our innovative, efficient and punctual performance. \r\n\r\nUnique Webers Ltd. are bound to provide Customized, Normalized and Dynamic Database Solutions. We provide requirements analysis, design, development, implementation and support of both Desktop and Web based Databases. \r\n\r\nUnique Webers Ltd. are the pioneers in Hybrid database technology which provides both multiuser online access like online database and speed of offline database in a single package meeting everyone&rsquo;s demand. \r\n\r\nUnique Webers Ltd. are specialized in energy saving database interfaces which is not only convenient and stylish but also friendly to our eyes.', 70);
